import React from "react";

import "./MemberDetailPage.scss";
import { useRecoilValueLoadable } from "recoil";
import { asyncGetMemberList, memberType } from "../lib/store/qna";
import { useLocation, useNavigate } from "react-router-dom";
import { MemberGutter } from "components/atom/MemberGutter";

export type MemberDetailPageProps = {
  cx?: string;
};
const useMember = (name: string) => {
  const { state, contents } = useRecoilValueLoadable(asyncGetMemberList);
  if (state === "hasValue") {
    return {
      state,
      contents: contents.find((i: memberType) => i.이름 === name),
    };
  } else {
    return { state, contents: {} };
  }
};

const type = (type: string) => {
  switch (type) {
    case "옵세르보":
      return "o";
    case "레크레아티":
      return "r";
    case "운트라":
      return "u";
    case "디솔루티":
      return "d";
    default:
      return "";
  }
};

export const MemberDetailPage: React.FC<MemberDetailPageProps> = ({
  cx = "",
}) => {
  const location = useLocation();
  const navigate = useNavigate();
  const { state, contents } = useMember(
    decodeURIComponent(location.pathname.split("/")[2])
  );

  if (state !== "hasValue") return null;
  return (
    <main className={`MemberDetailPage ${cx}`}>
      <section className="Logo">
        <svg
          onClick={() => navigate("/member")}
          xmlns="http://www.w3.org/2000/svg"
          width="109px"
          height="161px"
        >
          <image
            x="0px"
            y="0px"
            width="109px"
            height="161px"
            href="data:img/png;base64,"
          />
        </svg>
      </section>
      <section className={`short-info ${type(contents.계통)}`}>
        <div className="name">
          <div className="left">코드네임 : {contents.미메시스이름}</div>
          <div className="position u">
          <img
              src="data:img/png;base64,"
              alt=""
          />
        </div>
          <div className="position d">
            <img
                src="data:img/png;base64,"
                alt=""
            />
          </div>
          <div className="position r">
            <img
                src="data:img/png;base64,"
                alt=""
            />
          </div>
          <div className="position o">
            <img
                src="data:img/png;base64,"
                alt=""
            />
          </div><div className="right">{contents.이름}</div></div>
        <div className="catch">
          "<span>{contents.한마디}</span>"
        </div>
        <div className="info">
          <span>{contents.소속}</span>|<span>{contents.나이} 세</span>|
          <span>{contents.성별}</span>|<span>{contents.키} cm</span>
        </div>

        <div className="status-wrapper">
          <div className={"status"}>
            <span>체력</span>
            <span className={"number"}>{contents.체력}</span>
          </div>
          <div className="status">
            <span>공격력</span>
            <span className={"number"}>{contents.공격력}</span>
          </div>
          <div className="status">
            <span>방어력</span>
            <span className={"number"}>{contents.방어력}</span>
          </div>
          <div className="status">
            <span>통찰</span>
            <span className={"number"}>{contents.통찰}</span>
          </div>
          <div className="status">
            <span>정신력</span>
            <span className={"number"}>{contents.정신력}</span>
          </div>
        </div>
      </section>

      <section className="skill">
        <svg
            xmlns="http://www.w3.org/2000/svg"
            width="160px" height="43px">
          <image  x="0px" y="0px" width="160px" height="43px"  href="data:img/png;base64," />
        </svg>
        {contents.스킬.map((i:string)=><span key={i}>&lt;{i}&gt;</span>)}
      </section>

      <section className={`mime ${type(contents.계통)}`}>
        <svg
            xmlns="http://www.w3.org/2000/svg"
            width="300px" height="83px">
          <image  x="0px" y="0px" width="300px" height="83px"  href="data:img/png;base64," />
        </svg>

        <span className={'text'}>미메시스</span>
        <span className="mime-name">{contents.미메시스}</span>
        <p>{contents.미메시스설명}</p>
      </section>
      <section className="desc">
        <MemberGutter text={"외형"} cx={type(contents.계통)}>
          {contents.외형}
        </MemberGutter>{" "}
        <MemberGutter text={"성격"} cx={`${type(contents.계통)} l`}>
          {contents.성격}
        </MemberGutter>{" "}
        <MemberGutter text={"기타사항"} cx={`${type(contents.계통)} l`}>
          {contents.기타사항}
        </MemberGutter>
        <MemberGutter text={"오너 RP 성향"} cx={type(contents.계통)}>
          {contents.rp}
        </MemberGutter>
        <MemberGutter text={"관계"} cx={`${type(contents.계통)} l`}>
          {
            contents.관계.map((i:string,idx:number)=><><p key={idx}>{i}</p><hr/></>)
          }
        </MemberGutter>
      </section>
    </main>
  );
};
